CREATE TABLE DietaryInfoTable(
   ID                       INTEGER  NOT NULL IDENTITY (1,1) PRIMARY KEY 
  ,vegetable                VARCHAR(20) NOT NULL
  ,"Energy per 100g"        VARCHAR(14) NOT NULL
  ,"Fat per 100g"           VARCHAR(5) NOT NULL
  ,"Saturates per 100g"     VARCHAR(5)
  ,"Carbohydrates per 100g" VARCHAR(5) NOT NULL
  ,"Sugars per 100g"        VARCHAR(5) NOT NULL
  ,"Fibre per 100g"         VARCHAR(4)
  ,"Protein per 100g"       VARCHAR(5) NOT NULL
  ,"Salt per 100g"          VARCHAR(6)
  ,Size                     VARCHAR(4)
);
